import React, { useRef, useState } from 'react'
import { Canvas, useFrame } from '@react-three/fiber'

const box = () => {
    const myMesh = React.useRef()
    useFrame(({clock}) => {
      myMesh.current.position.y = Math.sin(clock.getElapsedTime())


    })
    return (
      <>
        <mesh ref={myMesh}>
          <boxGeometry args={[2, 2, 2]} />
          <meshPhongMaterial />
        </mesh>
      </>
    )

  }
  export default box
